description:
Galaxies, galaxies everywhere - as far as NASA's Hubble Space Telescope can see. This view of nearly 10,000 galaxies is the deepest visible-light image of the cosmos. Called the Hubble Ultra Deep Field, this galaxy-studded view represents a &quot;deep&quot; core sample of the universe, cutting across billions of light-years.
